import React from 'react'
import styles from './myservices.module.css'

const services = [
    {
        icon:'fa-solid fa-code',
        title:'Frontend Development',
        info:'I develop the frontend of web applications using HTML, CSS, JavaScript, and React'
    },
    {
        icon:'fa-regular fa-terminal',
        title:'Backend Development',
        info:'I develop server-side logic and manage APIs and databases with Java, Python, Django, or Flask'
    },
    {
        icon:'fa-solid fa-network-wired',
        title:'API Development',
        info:'I develop RESTful APIs with FastAPI or Flask'
    }
]

const InfoCard = ({item}) => {

    return(
        <>
            <div className={styles.icon}>
                <i className={item.icon}></i>
            </div>
            <div className={styles.title}>
                <h2>{item.title}</h2>
            </div>
            <div className={styles.info}>
                <p>{item.info}</p>
            </div>
        </>
    )
}

const MyServices = () => {

    return(
        <div className={styles.myservices}>
            <div>
                <h2>My</h2>
                <h2>Services</h2>
            </div>
            <div>
                {services.map(
                    (service,index) => <InfoCard key={index} item={service}/>)
                }
            </div>
        </div>
    );
}

export default MyServices
